import { events, buildUIMode, BuildingBlock, BuildingMaterial } from '@csegames/camelot-unchained';

class BuildingRequests {

  private materials: BuildingMaterial[] = [];

  public changeMode(mode: buildUIMode) {
    setTimeout(() => {
      console.log('changeMode to ' + mode);
      events.fire(events.buildingEventTopics.handlesBuildingMode, { mode });
    },         500);
  }

  public commit() {
    console.log('commit');
  }

  public undo() {
    console.log('undo');
  }

  public redo() {
    console.log('redo');
  }

  public rotX() {
    console.log('rotX');
  }

  public rotY() {
    console.log('rotY');
  }

  public rotZ() {
    console.log('rotZ');
  }

  public flipX() {
    console.log('flipX');
  }

  public flipY() {
    console.log('flipY');
  }

  public flipZ() {
    console.log('flipZ');
  }

  public requestMaterials() {
    setTimeout(() => {
      this.materials = this.getFakeMaterials();
      events.fire(events.buildingEventTopics.handlesBlocks, { materials: this.materials });
    },         1000);
  }

  public requestBlockSelect(block: BuildingBlock) {
    setTimeout(() => {
      this.invokeSelection(block);
    },         200);

  }

  public invokeSelection(block: BuildingBlock) {
    const material: BuildingMaterial = this.materials.find((material: BuildingMaterial) => {
      return material.id === block.materialId;
    });

    const info: any = { material, block };
    events.fire(events.buildingEventTopics.handlesBlockSelect, info);
  }

  public getBlockId(matId: number, shapeId: number) {
    return (matId << 2) | (shapeId << 21);
  }


  public getBlocks(material: number, tags: string[]): BuildingBlock[] {
    const shapeTags: string[][] =
      [
        ['cube'],
        ['cube', 'half-height'],
        ['ramp'],
        ['ramp, upper'],
        ['half, ramp'],
        ['cube","cutcorner'],
        ['angled","pyramid'],
        ['corner","pyramid'],
        ['mitered","ramp'],
        ['circle'],
      ];

    const blocks: BuildingBlock[] = [];
    for (let shapeId = 1; shapeId <= 10; shapeId++) {
      blocks.push({
        id: this.getBlockId(material, shapeId),
        icon: shapeId % 2 === 0 ? this.blockIcon1 : this.blockIcon2,
        shapeId,
        shapeTags: shapeTags[shapeId - 1],
        materialId: material,
        materialTags: tags,
      } as BuildingBlock);
    }

    return blocks;
  }

  public getAllBlocks(): BuildingBlock[] {
    const mats: BuildingMaterial[] = this.getFakeMaterials();
    const blocks: BuildingBlock[] = [];
    for (const m in mats) {
      const matBlocks = mats[m].blocks;
      blocks.push(...matBlocks);
    }
    return blocks;
  }

  public createMaterial(matId: number, type: string[]): BuildingMaterial {
    const tags: string[] = [...type, 'some', 'tags', 'to', 'test', 'with'];
    return new BuildingMaterial({
      id: matId,
      icon: matId % 2 === 0 ? this.materialIcon1 : this.materialIcon2,
      tags,
      blocks: this.getBlocks(matId, tags),
    } as BuildingMaterial);
  }

  public getFakeMaterials(): BuildingMaterial[] {
    const mats: BuildingMaterial[] = [];
    let i = 0;
    for (; i < 20; i++) {
      mats.push(this.createMaterial(i, ['stone']));
    }
    for (; i < 40; i++) {
      mats.push(this.createMaterial(i, ['stone', 'tile']));
    }
    for (; i < 60; i++) {
      mats.push(this.createMaterial(i, ['stone', 'sheet']));
    }
    for (; i < 80; i++) {
      mats.push(this.createMaterial(i, ['wood']));
    }
    for (; i < 90; i++) {
      mats.push(this.createMaterial(i, []));
    }
    return mats;
  }

  /* tslint:disable */
  private materialIcon1: string = '';

  private materialIcon2: string = '';

  private blockIcon1: string = '';

  private blockIcon2: string = '';
  
}
export default new BuildingRequests();
